cats = [int(x) for x in input().split()]
tree = [[] for _ in range(n + 1)]
for _ in range(n - 1):
    x, y = [int(x) for x in input().split()]
    tree[x].append(y)
    tree[y].append(x)


def dfs(node, parent, cats):
    if len(tree[node]) == 1 and node != 1:
        return 1
    if cats[node] == 1:
        return 0
    count = 0
    for child in tree[node]:
        if child != parent:
