def is_palindrome(n, base):
    s = ''
    while n > 0:
        s = s + str(n % base)
        n = n // base
    return s == s[::-1]


def count_palindromes(a, b, k):
    count = 0
    for n in range(a, b + 1):
        if all(is_palindrome(n, j) for j in range(2, k + 1)):
            count = count + 1
    return count


