    return s[::-1]


def swap(s):
    return s[0] + s[1:-1] + s[-1]


def play(s):
    if len(s) == 3:
        return s
    else:
        a = play(s[1:-1])
        b = play(s[0:-1])
        c = play(s[1:])
        return min(swap(s), swap(a) + swap(b), swap(c) + swap(a), swap(b) + swap(c),
            a + b + c, a + c + b, b + a + c, b + c + a, c + a + b, c + b + a)


