class Solution:

    def insert(self, intervals, newInterval):
        """
         :type intervals: List[Interval]
         :type newInterval: Interval
         :rtype: List[Interval]
         """
        if not intervals:
            return [newInterval]
        if not newInterval:
            return intervals
        new_start = newInterval.start
        new_end = newInterval.end
        start = 0
        end = len(intervals) - 1
        while start <= end:
            mid = (start + end) // 2
            if intervals[mid].start <= new_start <= intervals[mid].end:
                start = mid
                break
            elif intervals[mid].start > new_start:
                end = mid - 1
            else:
                start = mid + 1
        if start == len(intervals):
            intervals.append(newInterval)
            return intervals
        if intervals[start].end < new_start:
            start += 1
        while start <= end:
            mid = (start + end) // 2
            if intervals[mid].start <= new_end <= intervals[mid].end:
                end = mid
                break
            elif intervals[mid].start > new_end:
                end = mid - 1
            else:
                start = mid + 1
        if end == -1:
            intervals.insert(0, newInterval)
            return intervals
        if intervals[end].end < new_end:
            end += 1
        new_start = min(new_start, intervals[start].start)
        new_end = max(new_end, intervals[end - 1].end)
        return intervals[:start] + [Interval(new_start, new_end)] + intervals[end:]

