def get_prob(female, male):
    female_genes = female.split('-')
    male_genes = male.split('-')
    if female_genes[1] == '-':
        female_genes[1] = male_genes[1]
    if male_genes[1] == '-':
        male_genes[1] = female_genes[1]
    if female_genes[0] == 'O':
        if male_genes[0] == 'O':
            return 0.5, 'Red'
        elif male_genes[0] == 'o':
            return 0.5, 'Cream'
        else:
            return 0.5, 'Red'
    elif female_genes[0] == 'o':
        if male_genes[0] == 'O':
            return 0.5, 'Cream'
        elif male_genes[0] == 'o':
            return 0.5, 'Lilac'
        else:
            return 0.5, 'Cream'
    else:
        if male_genes[0] == 'O':
            if female_genes[1] == 'D':
                return 0.5, 'Black'
            elif female_genes[1] == 'd':
                return 0.5, 'Blue'
