def time_to_minutes(time):
    hours, minutes = time.split(':')
    return int(hours) * 60 + int(minutes)


def minutes_to_time(minutes):
    hours = minutes // 60
    minutes %= 60
    return '{:02}:{:02}'.format(hours, minutes)


def get_next_flash_time(time, interval):
    minutes = time_to_minutes(time)
    minutes += interval
    return minutes_to_time(minutes)


def get_next_flash_times(time, interval):
    times = []
    while time not in times:
        times.append(time)
        time = get_next_flash_time(time, interval)
    return times


def get_day_of_week(time):
    days = ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday',
        'Saturday']
    return days[time_to_minutes(time) // (24 * 60) % 7]


