def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return False
    return True


def get_primes(n):
    primes = []
    for i in range(2, n + 1):
        if is_prime(i):
            primes.append(i)
    return primes


def get_frog_tower(primes, frogs):
    max_pos = 0
    max_size = 0
    for pos, d in frogs:
        size = 0
        for prime in primes:
            if prime > d:
                break
            if pos % prime == 0:
                size += 1
        if size > max_size:
            max_pos = pos
            max_size = size
    return max_pos, max_size


