from collections import defaultdict


def prime_factors(n):
    factors = defaultdict(int)
    for i in range(2, n + 1):
        while n % i == 0:
            factors[i] += 1
            n //= i
    return factors


def get_factors(n):
    factors = prime_factors(n)
    return [1] + [factors[i] for i in range(2, 61)]


def get_piles(n, factors):
    piles = [0] * (n + 1)
    for i in range(1, n + 1):
        for j in range(i + 1, n + 1):
            if factors[i] >= factors[j]:
                piles[i] += 1
            if factors[i] >= factors[j] and factors[j] >= factors[i]:
                piles[j] += 1
    return piles


def get_max_pile(piles):
    max_pile = 0
    for pile in piles:
        if pile > max_pile:
            max_pile = pile
    return max_pile


def get_max_piles(piles):
    max_pile = get_max_pile(piles)
    return sum(pile == max_pile for pile in piles)


def main():
    n = int(input())
    factors = get_factors(n)
    piles = get_piles(n, factors)
    print(get_max_piles(piles) % MOD)


