def prime_factors(n):
    factors = []
    for i in range(2, int(n ** 0.5) + 1):
        while n % i == 0:
            factors.append(i)
            n //= i
    if n > 1:
        factors.append(n)
    return factors


def count_factors(n):
    factors = prime_factors(n)
    factor_counts = {}
    for factor in factors:
        if factor in factor_counts:
            factor_counts[factor] += 1
        else:
            factor_counts[factor] = 1
    return reduce(lambda x, y: x * y, (count + 1 for count in factor_counts.values()))


def count_ways(n):
    if n == 1:
        return 0
    if n == 2:
        return 1
    return (count_ways(n - 1) + count_ways(n - 2)) % MOD


