import sys
from itertools import permutations
from operator import add, mul
from functools import reduce
from collections import defaultdict

def eval_expr(expr, ops):
    return reduce(lambda x, y: ops[y](x, y), expr, expr[0])

def eval_exprs(expr, ops):
    return set(eval_expr(expr, ops) for ops in permutations(ops))

def main():
    expr = list(map(int, sys.stdin.readline().split()))
    ops = [add, mul]
    print(len(eval_exprs(expr, ops)))

main()

